/// <summary>
///  Checks that a scheduled route plan is not being assigned to more than one route guide
/// </summary>
/// <returns>
///  Returns true if the scheduled route plan in scope is not already tied to a route guide; otherwise, false
/// </returns>
public boolean checkRouteGuideOnScheduledRoutes()
{
    TMSRoute    route;
    boolean     ret = true;

    // Existing guides for scheduled routes should not allow for updates to plans
    if (this.RecId)
    {
        select firstOnly Name, RouteConfigCode from route
            where route.RouteGuideRecId == this.RecId
            &&    route.RouteSchedule   != 0
            &&    route.RouteConfigCode != this.RouteConfigCode;

        // Throw an error if the route plan is already tied to another route guide
        if (route.RouteConfigCode)
        {
            ret = checkFailed(strFmt("@TRX:ScheduleRoutePlanRouteGuideAssignmentValidationError", route.RouteConfigCode, route.Name));
        }
    }
    // New route guides will not have a RecId assigned yet, so make sure that the route plan is not already assigned to a separate route guide
    else
    {
        select firstOnly Name, RouteGuideRecId, RouteConfigCode from route
            where route.RouteConfigCode == this.RouteConfigCode
            &&    route.RouteSchedule   != 0
            &&    route.RouteGuideRecId != 0;

        // Throw an error if the route plan is already tied to another route guide
        if (route.RouteGuideRecId)
        {
            ret = checkFailed(strFmt("@TRX:ScheduleRoutePlanRouteGuideAssignmentValidationError", this.RouteConfigCode, route.Name));
        }
    }

    return ret;
}

/// <summary>
///  Checks whether a load has been assigned to a scheduled route.
/// </summary>
/// <returns>
///  Returns true is if a load has not been assigned to any scheduled routes based on the route guide and plan in scope, false otherwise.
/// </returns>
public boolean checkScheduledRouteGuideCanBeDeleted()
{
    TMSRoute        route;
    WHSLoadTable    loadTable;
    boolean         ret = true;

    select firstOnly RouteCode from route
        where route.RouteConfigCode == this.RouteConfigCode
        &&    route.RouteGuideRecId == this.RecId
        &&    route.RouteSchedule   != 0
        join LoadId from loadTable
                where loadTable.RouteCode == route.RouteCode;

    if (loadTable.LoadId)
    {
        ret = checkFailed(strFmt("@TRX:RouteGuideInUseValidation", route.RouteCode, loadTable.LoadId));
    }

    return ret;
}

public void insert()
{
    super();

    // Set guide references on scheduled routes
    this.updateScheduledRoutes();
}

/// <summary>
///  Updates applicable scheduled route routes with a reference to the current route guide record.
/// </summary>
/// <remarks>
///  Scheduled routes can be created before a route guide is assigned their route plan, therefore all routes that are associated with
///   the route plan and guide relationship should be updated with this information. For scheduled routes there is a strict one-to-one
///   relationship between a scheduled route plan and a route guide, so records that already contain route guide info will be skipped.
/// </remarks>
private void updateScheduledRoutes()
{
    TMSRoute        route;

    ttsbegin;

    // Update all route records that are not already populated with route guide data
    update_recordSet route
        setting
            Name              = this.RouteGuideCode,
            RouteGuideRecId   = this.RecId,
            InventSiteId      = this.InventSiteId,
            InventLocationId  = this.InventLocationId
        where route.RouteConfigCode == this.RouteConfigCode
        &&    route.RouteSchedule   != 0
        &&    route.RouteGuideRecId != this.RecId;

    ttscommit;
}

public boolean validateDelete()
{
    boolean ret;

    ret = super() && this.checkScheduledRouteGuideCanBeDeleted();

    return ret;
}

public boolean validateField(FieldId _fieldIdToCheck)
{
    boolean ret;

    ret = super(_fieldIdToCheck);

    switch (_fieldIdToCheck)
    {
        case fieldNum(TMSRouteGuide, InventLocationId):
            ret = this.InventStorageDimMap::validateField(fieldNum(InventStorageDimMap, InventLocationId));
            break;
        case fieldnum(TMSRouteGuide, EffectiveUTCDateTimeFrom):
        case fieldnum(TMSRouteGuide, EffectiveUTCDateTimeTo):
            if (this.EffectiveUTCDateTimeTo != utcDateTimeNull() && this.EffectiveUTCDateTimeFrom > this.EffectiveUTCDateTimeTo)
            {
                ret = ret && checkFailed("@SYS105946");
            }
            break;
        case fieldnum(TMSRouteGuide, VolumeLow):
        case fieldnum(TMSRouteGuide, VolumeHigh):
            if (this.VolumeHigh != 0 && this.VolumeLow > this.VolumeHigh)
            {
                ret = ret && checkFailed(strfmt("@TRX:LowerThan", fieldpname(TMSRouteGuide, VolumeHigh), fieldpname(TMSRouteGuide, VolumeLow)));
            }
            break;
        case fieldnum(TMSRouteGuide, WeightLow):
        case fieldnum(TMSRouteGuide, WeightHigh):
            if (this.WeightHigh != 0 && this.WeightLow > this.WeightHigh)
            {
                ret = ret && checkFailed(strfmt("@TRX:LowerThan", fieldpname(TMSRouteGuide, WeightHigh), fieldpname(TMSRouteGuide, WeightLow)));
            }
            break;
        case fieldnum(TMSRouteGuide, ContainerLow):
        case fieldnum(TMSRouteGuide, ContainerHigh):
            if (this.ContainerHigh != 0 && this.ContainerLow > this.ContainerHigh)
            {
                ret = ret && checkFailed(strfmt("@TRX:LowerThan", fieldpname(TMSRouteGuide, ContainerHigh), fieldpname(TMSRouteGuide, ContainerLow)));
            }
            break;
    }

    return ret;
}

public boolean validateWrite()
{
    boolean ret;

    ret = super();

    if (this.CarrierCode         == '' &&
        this.ModeCode            == '' &&
        this.CarrierGroupCode    == '' &&
        this.RouteConfigCode     == '')
    {
        ret = checkFailed("@TRX862");
    }

    // Verify that the route plan and route guide maintain a one-to-one relationship for scheduled routes
    if (this.RouteConfigCode != this.orig().RouteConfigCode)
    {
        ret = ret && this.checkRouteGuideOnScheduledRoutes();
    }

    ret = ret
        && this.validateCarrierServiceCode()
        && this.validatePostalCodes()
        && this.validateZoneMasters();

    return ret;
}

private boolean validatePostalCodes()
{
    boolean ret = true;

    if (this.OriginCountryRegion
        && this.OriginPostalCode
        && !this.isZipCodeValidForCountry(this.OriginCountryRegion, this.OriginPostalCode))
    {
        ret = checkFailed(strfmt("@GlobalAddressBook:InvalidZipForCountryRegion", this.OriginPostalCode, this.OriginCountryRegion));
    }

    if (this.DestCountryRegion
        && this.DestPostalCodeHigh
        && !this.isZipCodeValidForCountry(this.DestCountryRegion, this.DestPostalCodeHigh))
    {
        ret = checkFailed(strfmt("@GlobalAddressBook:InvalidZipForCountryRegion", this.DestPostalCodeHigh, this.DestCountryRegion));
    }

    if (this.DestCountryRegion
        && this.DestPostalCodeLow
        && !this.isZipCodeValidForCountry(this.DestCountryRegion, this.DestPostalCodeLow))
    {
        ret = checkFailed(strfmt("@GlobalAddressBook:InvalidZipForCountryRegion", this.DestPostalCodeLow, this.DestCountryRegion));
    }

    return ret;
}

private boolean validateCarrierServiceCode()
{
    boolean ret = true;

    if (this.CarrierCode != "" && this.CarrierServiceCode == '')
    {
        ret = checkFailed("@TRX733");
    }

    if (this.CarrierCode && this.CarrierServiceCode)
    {
        if (!TMSCarrierService::exist(this.CarrierServiceCode, this.CarrierCode))
        {
            ret = checkFailed("@TRX734");
        }
    }

    return ret;
}

private boolean validateZoneMasters()
{
    boolean ret = true;

    if (this.OriginZoneMasterCode
        && TMSZoneMaster::find(this.OriginZoneMasterCode).ZoneType != TMSZoneType::Routing)
    {
        ret = checkFailed("@TRX:MessageError_NonRoutingOriginZoneTypeForZoneMaster");
    }

    if (this.DestZoneMasterCode
        && TMSZoneMaster::find(this.DestZoneMasterCode).ZoneType != TMSZoneType::Routing)
    {
        ret = checkFailed("@TRX:MessageError_NonRoutingDestinationZoneTypeForZoneMaster");
    }

    if (this.OriginZone
        && !TMSZoneMasterDetail::existWithZoneMasterCodeAndZone(this.OriginZoneMasterCode, this.OriginZone))
    {
        ret = checkFailed("@TRX:MessageError_OriginZoneCriterionDoesNotExistInZoneMaster");
    }

    if (this.DestZone
        && !TMSZoneMasterDetail::existWithZoneMasterCodeAndZone(this.DestZoneMasterCode, this.DestZone))
    {
        ret = checkFailed("@TRX:MessageError_DestinationZoneCriterionDoesNotExistInZoneMaster");
    }

    return ret;
}

/// <summary>
/// Checks if a specific <c>TMSRouteGuide</c> record exists.
/// </summary>
/// <param name="_tmsRouteGuideCode">
/// Route guide code of the record.
/// </param>
/// <returns>
/// True if the record exists.
/// </returns>
public static boolean exist(TMSRouteGuideCode _tmsRouteGuideCode)
{
    return (_tmsRouteGuideCode) &&
           (select firstonly tmsRouteGuide
                where tmsRouteGuide.RouteGuideCode == _tmsRouteGuideCode).RecId != 0;
}

/// <summary>
/// Finds a specific <c>TMSRouteGuide</c> record with given parameters.
/// </summary>
/// <param name="_tmsRouteGuideCode">
/// Route guide code of the record.
/// </param>
/// <param name="_forupdate">
/// Determines whether the record is selected for update.
/// </param>
/// <returns>
/// The record that is searched for.
/// </returns>
public static TMSRouteGuide find(TMSRouteGuideCode _tmsRouteGuideCode,
                                 boolean           _forupdate = false)
{
    TMSRouteGuide    tmsRouteGuide;

    if (_tmsRouteGuideCode)
    {
        tmsRouteGuide.selectForUpdate(_forupdate);

        select firstonly tmsRouteGuide
            where tmsRouteGuide.RouteGuideCode == _tmsRouteGuideCode;
    }

    return tmsRouteGuide;
}

/// <summary>
/// Generates lookup for country information.
/// </summary>
/// <param name="_ctrl">
/// Form control
/// </param>
/// <param name="_countryRegion">
/// Country region.
/// </param>
public static void lookupZipCode(FormStringControl _ctrl, TMSCountryRegion _countryRegion = '')
{
    SysTableLookup          sysTableLookup;
    Query                   query;
    QueryBuildDataSource    queryBuildDataSource;

    sysTableLookup          = SysTableLookup::newParameters(tableNum(LogisticsAddressZipCode), _ctrl);
    query                   = new Query();
    queryBuildDataSource    = query.addDataSource(tableNum(LogisticsAddressZipCode));

    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressZipCode, ZipCode));
    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressZipCode, City));
    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressZipCode, CityAlias));
    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressZipCode, District));
    sysTableLookup.addLookupfield(fieldNum(LogisticsAddressZipCode, StreetName));

    if (_countryRegion)
    {
        queryBuildDataSource.addRange(fieldNum(LogisticsAddressZipCode, CountryRegionId)).value(queryValue(_countryRegion));
    }

    sysTableLookup.parmQuery(query);
    sysTableLookup.performFormLookup();
}

public void modifiedField(FieldId _fieldId)
{
    super(_fieldId);

    switch (_fieldId)
    {
        case fieldnum(TMSRouteGuide, OriginCountryRegion):
            if (!this.isZipCodeValidForCountry(this.OriginCountryRegion, this.OriginPostalCode))
            {
                this.OriginPostalCode = '';
            }
            break;
        case fieldnum(TMSRouteGuide, OriginPostalCode):
            if (!this.isZipCodeValidForCountry(this.OriginCountryRegion, this.OriginPostalCode))
            {
                this.OriginCountryRegion = '';
            }
            break;
        case fieldnum(TMSRouteGuide, DestCountryRegion):
            if (!this.isZipCodeValidForCountry(this.DestCountryRegion, this.DestPostalCodeLow))
            {
                this.DestPostalCodeLow = '';
            }
            if (!this.isZipCodeValidForCountry(this.DestCountryRegion, this.DestPostalCodeHigh))
            {
                this.DestPostalCodeHigh = '';
            }
            break;
        case fieldnum(TMSRouteGuide, DestPostalCodeLow):
            if (!this.isZipCodeValidForCountry(this.DestCountryRegion, this.DestPostalCodeLow))
            {
                this.DestCountryRegion = '';
            }
            break;
        case fieldnum(TMSRouteGuide, DestPostalCodeHigh):
            if (!this.isZipCodeValidForCountry(this.DestCountryRegion, this.DestPostalCodeHigh))
            {
                this.DestCountryRegion = '';
            }
            break;
    }
}

private boolean isZipCodeValidForCountry(str _country, str _postalCode)
{
    return _postalCode
        && _country
        && (select firstonly RecId from logisticsAddressZipCode
                where logisticsAddressZipCode.CountryRegionId == _country
                    && logisticsAddressZipCode.ZipCode == _postalCode).RecId != 0;
}

public void defaultField(FieldId _fieldId)
{
    super(_fieldId);

    switch (_fieldId)
    {
        case fieldNum(TMSRouteGuide, InventLocationId):
            if (this.isFieldSet(fieldNum(TMSRouteGuide, InventSiteId)))
            {
                this.InventStorageDimMap::defaultField(fieldNum(InventStorageDimMap, InventLocationId));
            }
            break;

        case fieldNum(TMSRouteGuide, InventSiteId):
            if (this.isFieldSet(fieldNum(TMSRouteGuide, InventLocationId)))
            {
                this.InventStorageDimMap::defaultField(fieldNum(InventStorageDimMap, InventSiteId));
            }
            break;
    }
}

