/// <summary>
/// Finds the specified record in the <c>TMSRouteGuide</c> table.
/// </summary>
/// <param name="_recId">
/// The record ID of the <c>TMSRouteGuide</c> to find.
/// </param>
/// <param name="_forUpdate">
/// A Boolean value that indicates whether to read the record for update; optional.
/// </param>
/// <returns>
/// A record in the <c>TMSRouteGuide</c> table; otherwise, an empty record.
/// </returns>
public static TMSRouteGuide findByRecId(RecId _recId, boolean _forUpdate = false)
{
    TMSRouteGuide tmsRouteGuide;

    if (_recId)
    {
        if (_forUpdate)
        {
            tmsRouteGuide.selectForUpdate(_forUpdate);
        }

        select firstOnly tmsRouteGuide
            where tmsRouteGuide.RecId == _recId;
    }

    return tmsRouteGuide;
}

